import {  Button, Container, FormControl, InputLabel, MenuItem, OutlinedInput, Select } from "@material-ui/core";
import { CheckBox } from "@mui/icons-material";
import { ListItemText } from "@mui/material";

function SearchFilters({ property }) {


const personName = 'joe'
const names = [
  'Oliver Hansen',
  'Van Henry',
  'April Tucker',
  'Ralph Hubbard',
  'Omar Alexander',
  'Carlos Abbott',
  'Miriam Wagner',
  'Bradley Wilkerson',
  'Virginia Andrews',
  'Kelly Snyder',
];

const MenuProps = {
  PaperProps: {
    style: {
      width: 250,
    },
  },
};

  return (
    <Container>
      <div>
        {property ? (
          <h3> Searching Properties {property}</h3>
        ) : (
          <h3> Searching Properties</h3>
        )}
      </div>
      <>
      <FormControl sx={{ m: 1, width: 300 }}>
        <InputLabel id="demo-multiple-checkbox-label">Tag</InputLabel>
        <Select
          labelId="demo-multiple-checkbox-label"
          id="demo-multiple-checkbox"
          multiple
          value={personName}
          onChange={null}
          input={<OutlinedInput label="Tag" />}
          renderValue={(selected) => selected.join(', ')}
          MenuProps={MenuProps}
        >
          {names.map((name) => (
            <MenuItem key={name} value={name}>
              <CheckBox checked={personName.indexOf(name) > -1} />
              <ListItemText primary={name} />
            </MenuItem>
          ))}
        </Select>
      </FormControl>
      </>
    </Container>
  );
}
export default SearchFilters;
